import { Container, Grid, Segment, Image } from "semantic-ui-react";
import styled from "@emotion/styled";
import { css, jsx } from "@emotion/core";
// import "reset-css";

// const HeaderWrapper = styled.header`
//   width: 100%;
//   background: pink;
//   color: #fff;
